import './App.css';

function App() {
  let url = 'http://localhost:8000/user/'
  const data = fetch(url).then(res => res.json())
    data.forEach(element => {
      console.log(element.name)
    });
  return (
    <div className="App">
      <header className="App-header">
      </header>
    </div>
  );
}

export default App;
